/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import { BrowserRouter, Route } from "react-router-dom";
import "./App.css";

import { Global } from "@emotion/react";
import global from "./styles/global";

import Footer from "./components/Footer";
import Navigation from "./components/Navigation";

import ScrollToTop from "./hooks/ScrollToTop";

import Work from "./routes/Work";
import About from "./routes/About";

import OLED from "./projects/OLED";
import Padintosh from "./projects/Padintosh";
import FireAlarm from "./projects/FireAlarm";
import ALD from "./projects/ALD";
import Bokdda from "./projects/Bokdda";
import Hydrogen from "./projects/Hydrogen";
import Toothbrush from "./projects/Toothbrush";
import JavaraLight from "./projects/JavaraLight";
import LiquidHydrogen from "./projects/LiquidHydrogen";
import projectList from "./ProjectList";

const Wrapper = styled.section`
  width: 100vw;
  flex-direction: column;
  display: flex;
  justify-content: center;
  align-items: center;
`;

function App() {
  return (
    <>
      <Global styles={global} />
      <Wrapper>
        <BrowserRouter>
          <ScrollToTop />
          {/* <Cursor /> */}
          <Navigation />
          <Route project={projectList} path="/" exact={true} component={Work} />
          <Route project={projectList} path="/Work" component={Work} />
          <Route project={projectList} path="/About" component={About} />
          <Route project={projectList} path="/OLED" component={OLED} />
          <Route
            project={projectList}
            path="/Padintosh"
            component={Padintosh}
          />
          <Route
            project={projectList}
            path="/FireAlarm"
            component={FireAlarm}
          />
          <Route project={projectList} path="/ALD" component={ALD} />
          <Route project={projectList} path="/Bokdda" component={Bokdda} />
          <Route project={projectList} path="/Hydrogen" component={Hydrogen} />
          <Route
            project={projectList}
            path="/Toothbrush"
            component={Toothbrush}
          />
          <Route
            project={projectList}
            path="/JavaraLight"
            component={JavaraLight}
          />
          <Route
            project={projectList}
            path="/LiquidHydrogen"
            component={LiquidHydrogen}
          />
          <Footer />
        </BrowserRouter>
      </Wrapper>
    </>
  );
}

export default App;
